import React from 'react';
import { Button } from 'antd';
import { MenuFoldOutlined, PoweroffOutlined } from '@ant-design/icons';
import Logo from '../../../assets/img/png/logo.png';

import './MenuTop.scss';

export default function MenuTop() {
    return (
        <div className='menu-top'>
            <div className='menu-top__left'>
                <img className='menu-top__left-logo'
                    src={Logo}
                    alt="Jorge Lynch"
                /><span className='menu-top__left-logo__ini'> Capa</span>ces.com
                <Button type='Link' onClick={() => console.log('Click')}>
                    <MenuFoldOutlined />
                </Button>
            </div>
            <div className='menu-top__right'>
                <Button type='Link' onClick={() => console.log('Saliendo')}>
                    <PoweroffOutlined />
                </Button>
            </div>
        </div>
    )
}
